import React from 'react';
import BizHeader from './BizHeader';
import HomePage from './HomePage';
import NavBar from './Navbar';

function App() {
  return (
    <React.Fragment>
      <NavBar />
      <BizHeader />
      <HomePage />
    </React.Fragment>
  );
}

export default App;
